import { Link } from "react-router-dom";

function SecondCard(props) {
  const { info } = props;
  return (
    <Link to={`/infos/${info.slug}`} className='second-blog-card'>
      {info.type === "podcast" && (
        <img
          src='/images/podcast-icon.png'
          alt=''
          className='second-card-icon'
        ></img>
      )}
      {info.type === "blog" && (
        <img
          src='/images/blog-icon.png'
          alt=''
          className='second-card-icon'
        ></img>
      )}
      {info.type === "video" && (
        <img
          src='/images/video-icon.png'
          alt=''
          className='second-card-icon'
        ></img>
      )}
      <h1 className='second-card-title'>{info.title}</h1>
      <p className='second-card-desc'>{info.description}</p>
      <img src={info.image} className='second-card-img' alt={info.name} />
    </Link>
  );
}
export default SecondCard;
